import PropTypes from 'prop-types';
import React, { Component } from 'react';
import { connect } from 'react-redux';
import { firebaseConnect, firestoreConnect } from 'react-redux-firebase';
import { compose } from 'redux';
import Countdown from './Countdown';
import PaymentForm from './PaymentForm';
import Spinner from './Spinner';



class AuthenticatedView extends Component {

  state = {
    isAuthenticated: false,
    isSameUser: false
  }

  static getDerivedStateFromProps(props, state) {
      const { firestore, auth, access } = props;

      if (! auth.uid || ! access) {
        return { isAuthenticated: false };
      }

      if (auth.uid && access) {
          if (access.user === "") {
            firestore.update('access/' + access.id, {user: auth.uid});
            return { isAuthenticated: true, isSameUser: false };
          }
          if (auth.uid === access.user) {
            return { isAuthenticated: true, isSameUser: true };
          } else {
            return { isAuthenticated: true, isSameUser: false };
          }
      }
  }

  render() {

    const { firebase, access } = this.props;

    firebase.auth().signInAnonymously().catch(error => {
        console.log(error);
        alert('Hubo un problema al revisar tu dispositivo');
    });

    const { isAuthenticated, isSameUser } = this.state;

    if ( ! isAuthenticated || ! access) {
        return (<Spinner/>);
    }
    if(access) {
        return (
          <div>
            {
              isSameUser ?
                (
                  <div className="authenticated">
                    <div className="logo" >
                      <Icon fill="#fafafa" />
                    </div>
                    <div className="contador">
                      <Countdown/>
                    </div>
                    {/* <img className="logo" alt="Casper Logo" src={logo} onError={this.onErrorImage(this)} /> */}
                    <PaymentForm access={access} />
                    {/* <Restantes /> */}
                  </div>
                ) : 
                (
                  <h1>Este link ya fue tomado por otro usuario, ped√≠ uno nuevo antes que se acaben las entradas</h1>
                )
            }
          </div>
        )

    }
  }
}

AuthenticatedView.propTypes = {
    firebase: PropTypes.object.isRequired
}

export default compose(
    firebaseConnect(),
    firestoreConnect(props => [
        { collection: 'access', doc: props.match.params.id}
    ]),
    connect((state, props) => ({
        access: state.firestore.ordered.access && state.firestore.ordered.access[0],
        auth: state.firebase.auth
    }))
)(AuthenticatedView);

